Last month, I began having conversations with some Black Germantown residents about the Supine Horizons exhibition at the @kddtheatre in Germantown.

These conversations were centered around their ideas of rest and grind culture as it related to the exhibition. So much great thought-making came from these conversations. I purposely didn’t rush this story because I felt it would dishonor the entire message this exhibit and my work were sending. So instead, I focused this story as a reflection piece using the voices of the Black residents of Germantown.

There were five major themes I discovered while speaking to these folks:

1. Rest spaces are crucial because they challenge us to slow down.

2. Resting disrupts the harmful tropes and generational cycles.

3. Slowing down could support health and wellness.

4. Rest is an antithesis of the white supremacist values that helped build this country.

5. Supine Horizons contributed to the historical significance and contemporary renaissance happening in Germantown.

I invite folks to read this piece published by the @gtowninfohub and written by me. I’m very proud of what I poured out. And I’m grateful for the folks who poured into me for this including:

@nomad_face 
@ksc.creative 
@bydorianadiaz 
@nicpoll 
@tvsky_gralin 
@nappy.crowned.lena 
and Krystal Dillard

And I also thank @thenapministry, as they were a common point of reference in most of my conversations. Their work is mentioned throughout the piece, so I also encourage folks to buy “Rest IS Resistance” for the holidays and ponder on those lessons.

You can read this using the link in my story, link in my bio, and on www.germantowninfohub.org.
